import React from 'react';
import { Canvas, Camera } from '@react-three/fiber';
import './App.css';
import {Cube} from "./components/cube";

function App() {
    let camera: Camera = {
        fov: 75,
        near: 10,
        far: 15,
        position: [0,0,0]
    }

  return (
      <div id="canvas-container">
        <Canvas camera={camera}>
            <Cube x={2} y={2} z={2} color="red" position={[-3,0,0]}/>
            <Cube x={2} y={2} z={2} color="red" position={[3,0,0]}/>
        </Canvas>
      </div>
  );
}

export default App;
